    jefes.nombre_jefe,
    jefes.cargo_jefe,
    jefes.numero_contacto_jefe,
    jefes.email_jefe,
    arl.nombre_arl
FROM
    fichas
        LEFT JOIN
    detalle_fichas_aprendices ON fichas.id_ficha = detalle_fichas_aprendices.id_ficha
        LEFT JOIN
